import React, { Component } from "react";

class Footer extends Component {
  render() {
    return (
      <div className="footer py-5">
        <div class="ht-tm-codeblock ht-tm-btn-replaceable">
          <div class="ht-tm-element btn-group btn-group-toggle" data-toggle="buttons">
            <label class="btn btn-outline-primary active">
            Radio 3
              <input type="radio" name="options" id="radio-option-1" autocomplete="off" checked="" value="Radio 3"></input>
            </label>
            <label class="btn btn-outline-primary">
            Radio 4
              <input type="radio" name="options" id="radio-option-2" autocomplete="off" checked="" value="Radio 4"></input>
            </label>
          </div>
          <p>toffy</p>
        </div>
      </div>
    );
  }
}

export default Footer;
